(8, 5, 'Buy Club Furni', 1, 9, '1', '1', 1, '0', 2, 'default_3x3', 'catalog_header_hc', 'catalog_hc_teaser', '', 'We''ve got all that exclusive club furniture available for you right here .. but for an exclusive price.', '', 0, '', '', '0', '', ''),
