(123, 4, 'Hello', 0, 35, '1', '1', 1, '0', 2, 'default_3x3', 'catalog_hello_header1_en', 'catalog_hello_teaser1_en', '', 'Hello Furni is available with Pixels and is perfect if you are decorating your room for the very first time. The Furni is yours to keep and therefore cannot be traded.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(125, 4, 'Special Effects', 0, 61, '0', '0', 1, '0', 4, 'default_3x3', 'catalog_pixeleffects_headline1_en', 'catalog_pxl_teaser1_en', '', 'Tune your character with cool effects that fit the occasion. Ride the hoverboard and spit on the mic. Effects can be activated from the menu, by clicking on your avatar.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(126, 3, 'Tiki', 0, 59, '1', '1', 1, '0', 63, 'default_3x3', 'catalog_tiki_header1_en', 'tiki_teaser', '', 'Imagine in the scene.. lost on a desert island when you stumble across a small local tribe.. now you can with our Tiki range!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(128, 3, 'Urban', 0, 26, '1', '1', 1, '0', 66, 'default_3x3', 'urban_header_en', 'urban_teaser_en', '', 'New York City styled furni range, Urban is perfect for any street, alleyway or road. Rubbish bins, street lights and benches, all the Urban furniture you need!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(129, 4, 'Automobile', 0, 16, '1', '1', 1, '0', 1, 'default_3x3', 'catalog_automobile_header1_en', 'catalog_automobile_teaser1_en', '', 'Every Uber needs a car effect! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful traffic sign or elegant pile of tires...', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(134, 204, 'Various Stuff', 0, 1, '1', '1', 6, '0', 390, 'default_3x3', 'catalog_frontpage_headline2_en', '', '', '', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(136, 3, 'Bling', 0, 42, '1', '1', 1, '0', 11, 'default_3x3', 'catalog_frontpage_headline2_en', 'catalog_teaser_bling11', '', 'Bling, Bling! Flash, Flash! Want to have that real celebrity lifestyle? Well, go somewhere else, all we have here is a tacky range of furni.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(137, 3, 'Orgie', 51, 51, '1', '1', 1, '0', 45, 'default_3x3', 'catalog_frontpage_headline2_en', '', '', 'The latest range from Ann Summers, the Orgie line. Made of soft, wipe clean plastic, its perfect for any three, four or fivesome!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(139, 14, 'Pets Info', 0, 42, '0', '1', 1, '0', 10, 'pets2', 'catalog_pet_headline1', 'ctlg_pet_note', '', 'Pets are inhabitants of uberHotel too, so each pet owner needs to know a bit about them. Look after your pet by looking through our key points below.', '', 0, '', '- You cannot trade or give away pets. Once you purHabbo them, they will be yours forever.\r\n- You can own as many as you want, but you can have no more than 5 pets per room.\r\n- You can take pets with you to other rooms, should the room owner allow you to do so.\r\n- Your pet needs to be trained before it''ll listen to your commands. By training your pets, you can gain some awesome achievements as well.', '0', '', ''),
(141, 14, 'Pigs', 0, 67, '1', '1', 1, '0', 11, 'pets', 'catalog_pet_headline1', '', '', 'These little scamps were destined for the dining table until we struck a deal with a local farmer to rescue their cute pigtails! Adopt your little piglet today, all you need now is a name.', '', 0, 'Give a name:Pick a color:Pick a race:', '', '0', '', ''),
(142, 3, 'Pet Accessories', 0, 43, '1', '1', 1, '0', 48, 'default_3x3', 'catalog_pet_headline1', 'ctlg_pet_teaser1', 'catalog_special_txtbg2', 'This page has everything you need to give your pet the happy life it deserves. We''ve got a huge selection!', '', 0, 'Click on an item for more information.', 'Keep ''em happy!', '0', '', ''),
(143, 3, 'Flower Power', 0, 73, '1', '1', 1, '0', 22, 'default_3x3', 'flowerpower', '', '', 'Woah! Far out man... let the petals take control. Lets collaborate on a hippy hideout and plant some seeds! Lucy in the sky with diamonds style eyy?!', '', 0, 'Click on an item for more information.', '', '0', '', ''),
(144, 3, 'Runway', 0, 74, '1', '1', 1, '0', 54, 'default_3x3', 'runway_header_en', 'runway_teaser_en', '', 'Spice up your salon, hair parlour or boutique with our stylish yet practical range! From sewing machines to comfy seating, we''ve got the perfect option for you.', '', 0, 'Click on an item for more information.', '', '0', '', ''),
