(169, 14, 'Spider', 1, 95, '1', '1', 1, '0', 13, 'pets', 'catalog_pet_headline1', '', '', 'One of the most feared creatures in nature, and perhaps the most misunderstood. The majority of Spiders are predators with sharp fangs that inject venom into their prey- but dont worry, these spiders wont bite you! Maybe...', '', 0, 'Name your pet:', '', '0', '', ''),
